import heyday from "../heyday.png";

const Top = () => {
  return (
    <div>
      <img src={heyday} alt="logo" />
      <p>WHAT WE DO</p>
      <p>We Help Local Dental Practices To Acquire More Leads Through Social Media</p>
      
    </div>
  );
};

export default Top;
